Here is the Solidity code for the contract based on the provided descriptions:

```solidity
pragma solidity 0.6.12;

contract Proxy {
    address public upgradeabilityOwner;
    string public version;
    address public implementation;

    constructor() public {
        upgradeabilityOwner = msg.sender;
    }

    fallback() payable external {
        if (implementation != address(0)) {
            (bool success,) = implementation.delegatecall(msg.data);
            if (!success) {
                revert();
            }
        }
    }

    function transferProxyOwnership(address newOwner) public {
        require(msg.sender == upgradeabilityOwner && newOwner != address(0));
        upgradeabilityOwner = newOwner;
    }

    function upgradeTo(string memory newVersion, address newImplementation) public {
        require(msg.sender == upgradeabilityOwner && newImplementation != address(0));
        require(keccak256(abi.encodePacked((newVersion))) > keccak256(abi.encodePacked((version))));
        version = newVersion;
        implementation = newImplementation;
    }

    function upgradeToAndCall(string memory newVersion, address newImplementation, bytes memory data) payable public {
        require(msg.sender == upgradeabilityOwner && newImplementation != address(0));
        require(keccak256(abi.encodePacked((newVersion))) > keccak256(abi.encodePacked((version))));
        version = newVersion;
        implementation = newImplementation;
        (bool success,) = implementation.delegatecall(data);
        if (!success) {
            revert();
        }
    }
}
```

